import React from 'react';
import ticketList from './ticketList.json';

function Tickets () {
    const tick = ticketList.tickets;

    function sortByPrice(tick) {
        tick.sort((a, b) => a.price > b.price ? 1 : -1);
      }

      sortByPrice(tick)

    return(
        <ul className="tickets">
            {tick.map(item => (
                <li key={item.price} className="everyTick">
                    <div>
                        <img url="" alt="avia"/>
                        {item.price}
                    </div>
                    {item.origin}
                    {item.origin_name}
                    {item.destination}
                    {item.destination_name}
                    {item.departure_date}
                    {item.departure_time}
                    {item.arrival_date}
                    {item.arrival_time}
                    {item.carrier}
                    {item.stops}

                </li>
            ))}
        </ul>
    )
}

export default Tickets;
